import React, { useState } from 'react';
import Tabletop from 'tabletop';
import { useSelector, useDispatch } from "react-redux";
import classes from './Company.module.css';

import {
    selectSheet,
} from "../company/companySlice";

const Company = () => {
    const sheet = useSelector(selectSheet);
    const table = sheet['資生堂' + '_' + 'table']

    return (
        <div>
            <header className={classes.header}>
                <div>{table.name.slice(0, -6)}</div>
            </header>
            <div>
                <div className={classes.table_box}>
                    {table.elements.map((each) => (
                        <dl className={classes.tag_dl}>
                            <dt className={classes.tag_dt}>{each.項目}</dt>
                            <dd className={classes.tag_dd}>{each.内容}</dd>
                        </dl>
                    ))}
                </div>
                <span>refer to <br/>
                    {table.elements[0].url}
                </span>
            </div>
        </div>
    )
}

export default Company
